// import logo from './images/revs.png';
import './customerWindowGUI.css';

function Customer() {
  return (
    <div className="Customer">
      <header className="Customer-header">

        <div className="menu-items-burgers">
            <ul>
                <li><h2>Burgers</h2></li>
                <li><h3>Revs's Burger</h3><div><p>Bacon</p></div></li>
                <li><h3>Double Stack Cheeseburger</h3><div><p>Bacon</p></div></li>
                <li><h3>Classic Burger</h3><div><p>Bacon</p></div></li>
                <li><h3>Bacon Cheeseburger</h3><div><p>Bacon</p></div></li>
            </ul>
        </div>
      </header>
    </div>
  );
}

export default Customer;
